import Navbar from "../Navbar/Navbar.jsx"
import styles from "./About.module.css"

export default function About(){
    return(
        <>
            <Navbar/>
            <div className={styles.about}>
                <h1>About</h1>
                {/* <img src={require("../../assets/about-main_img.jpg")} alt="img"/> */}
                <p>Lore</p>
            </div>
        </>
    )
}
